import React, { useState } from 'react';
import './navbar.css';
import logo from '../../assets/logo.png';

function Navbar() {
    return (
        <div className="navbar">
            <div className="about">
            <button onClick={() => window.location.href = '#About'}>Обо мне</button>
            </div>
            <div className="training">
                {<p><a href='#wgpt3'>Тренировки</a></p>}
            </div>
            <div className="center-logo">
            <img src={logo} alt="Logo" />
            </div>
            <div className="price">
                {<p><a href='#possibility'>Цены</a></p>}
            </div>
            <div className="contacts">
                {<p><a href='#features'>Обратная связь</a></p>}
            </div>
        </div>
    );
}

export default Navbar;

function MyButton() {
    // Обработчик клика кнопки
    const handleClick = () => {
        alert('Кнопка нажата!');
    };

    // Возвращаем кнопку
    return (
        <button onClick={handleClick}>
            Нажми меня
        </button>
    );
}
